            <div className="main">

                <div className="board">
                    {phrase.map(letter => (
                        <Letter
                            value={letter}
                        />
                    ))
                    }
                </div>


                    {/* // image="https://github.com/4yerik/images/blob/master/family/senior.png?raw=true"
